--
-- Name: active_prerequisites; Type: VIEW; Schema: public; Owner: admin
--

CREATE VIEW public.active_prerequisites AS
 SELECT cp.id,
    cp.course_id,
    cp.prerequisite_id,
    cp.type,
    cp.min_grade,
    cp.notes,
    cp.created_at,
    cp.updated_at,
    cp.minimum_grade,
    cp.additional_requirements,
    cp.is_active,
    cp.applicable_terms,
    cp.exemption_conditions,
    cp.effective_from,
    cp.effective_until,
    cp.modified_by,
    cp.modification_reason,
    c1.code AS course_code,
    c1.title AS course_title,
    c2.code AS prerequisite_code,
    c2.title AS prerequisite_title
   FROM ((public.course_prerequisites cp
     JOIN public.courses c1 ON ((cp.course_id = c1.id)))
     JOIN public.courses c2 ON ((cp.prerequisite_id = c2.id)))
  WHERE ((cp.is_active = true) AND ((cp.effective_from IS NULL) OR (cp.effective_from <= CURRENT_DATE)) AND ((cp.effective_until IS NULL) OR (cp.effective_until >= CURRENT_DATE)));


