--
-- Name: document_statistics; Type: VIEW; Schema: public; Owner: admin
--

CREATE VIEW public.document_statistics AS
 SELECT context,
    category,
    count(*) AS total_documents,
    sum(size) AS total_size,
    avg(size) AS avg_size,
    count(DISTINCT uploaded_by) AS unique_uploaders,
    count(
        CASE
            WHEN ((status)::text = 'verified'::text) THEN 1
            ELSE NULL::integer
        END) AS verified_count,
    count(
        CASE
            WHEN ((status)::text = 'rejected'::text) THEN 1
            ELSE NULL::integer
        END) AS rejected_count,
    count(
        CASE
            WHEN ((status)::text = 'pending_verification'::text) THEN 1
            ELSE NULL::integer
        END) AS pending_count,
    max(created_at) AS latest_upload,
    min(created_at) AS earliest_upload
   FROM public.documents
  WHERE (deleted_at IS NULL)
  GROUP BY context, category;


